import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';
import App from './App';
import "./index.css";
import MenuContainer from "./MenuContainer";

ReactDOM.render(
  <MenuContainer/>, 
  document.querySelector("#container")
);

ReactDOM.render(
  <React.StrictMode>
    <App />
  </React.StrictMode>,
  document.getElementById('root')
);



